  const onUserDeleteHandler = () => {
    console.log("DELETE!")
  }

  return (
    <li className='row' style={{margin: "1rem"}}>
      <div className="col-xl cell-area">{props.username}</div>
      <div className="col-xl cell-area">{props.userLevel}</div>
      <button className="col-sm btn btn-danger" type="button" onClick={onUserDeleteHandler}>Delete user</button>
    </li>
  );
}

export default SingleUser;
